const initialState = {
  items: [],
};

const questionsTasksReducer = (state = initialState, action) => {
  if (action.type === "ACTIONS_QUESTIONS_TASKS") {
    console.log(action);
    return {
      ...state,
      items: action.payload,
    };
  }
  return state;
};

export default questionsTasksReducer;
